import React from 'react';
import './Navbar.css';
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <a href="#">Home</a>
          <link to="/">Home</link>
        </li>
        <li>
          <a href="#">Movies</a>
        </li>
        {/* <li>
          <a href="#">TV Series</a>
        </li> */}
        <li>
          <a href="#">Most Popular</a>
        </li>
        <li>
          <a href="#">Top Airing</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
